const About = () => {
	return (
		<main className="about-container">
			<h2>Welcome to self.OKRs</h2>
			<h3>Why</h3>
			<p>Modern life is so filled with tasks and distractions, that it's often easy to loose track of one's mid and long term goals.</p>
			<p>With self.OKRs you can set meaningful objectives and manage their progress.</p>
		</main>
	);
}

export default About;
